import React from "react";
import Styles from "./WelcomePage.module.css";

const SignupForm = () => {
	return (
		<div className={Styles.container}>
			<div className={Styles.signAndLoginContainer}>
				<h1>Welcome page</h1>
			</div>
		</div>
	);
};
export default SignupForm;
